<p><canvas id="canvas" width="600" height="600"></canvas></p>
<script type="text/javascript">

  
  
  $(function(){
    	
  
  
function sketchProc(processing) {
  var dot_radius = 2.5;
  var canvas_h = 600;
  var canvas_w = 600;
  var width = Math.min(canvas_h,canvas_w);
  var radius = width/2;
  var origin = new processing.PVector(300, 300);
  var acceleration = 0.5;
  
  var update = function(){
    var mouse = new processing.PVector(processing.mouseX, processing.mouseY);
    
    for(var si = 0; si < data.length; si++){
      for(var ri = 0; ri<data[si].length; ri++){
        var result = data[si][ri];
       
        var accel = processing.PVector.sub(mouse, result.position)
        accel.normalize()
        accel.mult(acceleration);
        result.velocity.add(accel);
        result.position.add(result.velocity); 
        
        var from_origin = processing.PVector.sub(origin,result.position);
        if(from_origin.mag() > (radius-dot_radius) ){
           
          from_origin.normalize();
          
          from_origin.mult(radius-(dot_radius) );
          from_origin.add(origin)
          result.position = from_origin;
          
          var newvel = new processing.PVector(0,0);
          newvel.sub(result.velocity);
          result.velocity = newvel;
        }
      }
    }
    
  };

  var background = function(){
  	processing.background(255,255,255);
    processing.fill(0,0,0);
    
    processing.ellipse(canvas_w/2,canvas_h/2,width,width);
  }
  
  processing.draw = function() {
    update();
    background();
   	for(var si = 0; si < data.length; si++){
      for(var ri = 0; ri<data[si].length; ri++){
        var result = data[si][ri];
        if(result.category == "both"){processing.fill(0,255,0);}
        if(result.category == "anonymous"){processing.fill(0,0,255);}
        if(result.category == "personal"){processing.fill(255,0,0);}
        processing.ellipse(result.position.x, result.position.y, dot_radius*2,dot_radius*2);
      }
    }
  };
  processing.setup = function(){
    for(var si = 0; si < data.length; si++){
      for(var ri = 0; ri<data[si].length; ri++){
        var result = data[si][ri];
        var r = Math.random()*radius;
        var t = Math.random()*2*Math.PI;
        result.position = new processing.PVector(Math.sin(t)*r + origin.x,Math.cos(t)*r + origin.x);
        result.velocity = new processing.PVector(0, 0);
      }
    }
  	processing.size(600,600);
    processing.fill(255);
    background();
    processing.noStroke();
  }
  
}

var canvas = document.getElementById("canvas");

var p = new Processing(canvas, sketchProc);
  
});
</script>
